    # Check if the number is of the form (2^k - 1) * 2^k for some integer k
    k = 1
    while True:
        woodall_number = (2 ** k - 1) * 2 ** k
        if woodall_number == n:
            return True
        if woodall_number > n:
            return False
        k += 1

