def even_binomial_Coeff_Sum(n):
    # Initialize the sum to 0
    sum = 0
    # Loop through all numbers from 0 to n
    for i in range(0, n + 1):
        # Check if the index is even
        if i % 2 == 0:
            # Add the binomial coefficient C(n, i) to the sum
            sum += (1 << i)
    return sum

